INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 130011, 2, 3001100, 1, -416.5, 100, "ヤマト", 2.1, 3001);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 130011, 2, 3001101, 4, -416.5, 101, "ヤマト", 5.68, 3001);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 130011, 1, 3001102, 1, -416.5, 102, "ヤマト", 0.0, 3001);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 130211, 1, 3002100, 1, -416.5, 100, "フブキ", 0.0, 3002);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 130211, 1, 3002101, 1, -416.5, 101, "フブキ", 0.0, 3002);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 130211, 2, 3002102, 5, -416.5, 102, "フブキ", 8.53, 3002);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 130211, 1, 3002103, 7, -416.5, 103, "フブキ", 5.67, 3002);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 130211, 1, 3002104, 1, -416.5, 104, "フブキ", 0.0, 3002);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 130211, 3, 3002300, 3, -416.5, 300, "フブキ", 0.0, 3004);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 130211, 7, 3002400, 7, -416.5, 301, "フブキ", 0.0, 3005);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 130211, 1, 3003200, 2, -416.5, 200, "フブキ", 4.4, 3003);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 130211, 7, 3003201, 7, -416.5, 201, "フブキ", 0.0, 3003);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 130211, 2, 3003202, 1, -416.5, 202, "フブキ", 5.6, 3003);
